        super(props);
        this.state = {
           header: "HALO HALOOO",
           isi: "Welcome to our Page"
        }
     }
     componentDidMount() {         
        alert(`Tugas Akhir Kelompok 9`)   
    }
     render() {
        return (
           <div>
              <header className="App-header">
              <Name>{this.state.header}</Name>
               <Name>{this.state.isi}</Name>
      <div>
          <Header/>
      </div>
      <div>
        <Card/>
      </div>

               



      </header>
           
           </div>
        );
     }
}

export default A;
